tables.table_schema:
CREATE TABLE error_logs (
    error_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    error_message TEXT,
    severity VARCHAR(50)
);

CREATE TABLE error_logs (
    error_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    source VARCHAR,
    message TEXT
);

CREATE TABLE connection_logs (
    connection_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    source_ip VARCHAR,
    destination_ip VARCHAR
);

CREATE TABLE status_logs (
    status_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    type VARCHAR,
    message TEXT
);

CREATE TABLE analysis_logs (
    analysis_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    analyzer VARCHAR,
    result TEXT
);
